function parseFile(out)
	out=string.lines(out)
	local c=0
	for i, v in ipairs(out) do
		if v:sub(1,1)==':' then
			c=c+1
		end
	end
	local eval1=vectorn(c)
	local eval2=vectorn(c)

	c=0
	for i, v in ipairs(out) do
		if v:sub(1,1)==':' then
			local vv=string.tokenize(v,'%s+')
			local iframe=tonumber(vv[2])
			local ev=tonumber(vv[3])
			local evv=tonumber(vv[4])
			eval1:set(c, ev)
			eval2:set(c, evv)
			c=c+1
		end
	end

	return eval1, eval2,c

end

